CREATE TABLE `asegurado` (
  `id_cliente` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(255) DEFAULT NULL,
  `fecha_nac` varchar(20) DEFAULT NULL,
  `dni` varchar(20) DEFAULT NULL,
  `calle` varchar(255) DEFAULT NULL,
  `numero` varchar(10) DEFAULT NULL,
  `piso` varchar(10) DEFAULT NULL,
  `localidad` varchar(255) DEFAULT NULL,
  `marca` varchar(255) DEFAULT NULL,
  `anio` varchar(5) DEFAULT NULL,
  `patente` varchar(20) DEFAULT NULL,
  `motor` varchar(50) DEFAULT NULL,
  `chasis` varchar(50) DEFAULT NULL,
  `referente` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id_cliente`)
) ENGINE=InnoDB AUTO_INCREMENT=3044 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `usuario` (
  `username` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `id_user` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id_user`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


